(636, '_options_strategy_section_1_stra_title', 'field_660cda2f8d158', 'no'),
(637, 'options_strategy_section_1_stra_description', 'Creative team develops a design that conveys your unique value proposition and drives results by creating an intuitive and engaging user experience, ensuring every aspect of the design meets your business objectives.', 'no'),
