(642, '_options_strategy_section_2_stra_title', 'field_660cda2f8d158', 'no'),
(643, 'options_strategy_section_2_stra_description', 'Developers bring the design to life, ensuring the website or application is fully functional, responsive, and optimised for users, search engines optimisations and social media, conducting thorough testing to meet high-quality requirements.', 'no'),
