(870, 22, 'strategy_section_0_stra_image', '303'),
(871, 22, '_strategy_section_0_stra_image', 'field_65d82e45958ee'),
(872, 22, 'strategy_section_0_stra_title', 'Strategy'),
(873, 22, '_strategy_section_0_stra_title', 'field_65d82e57958ef'),
(874, 22, 'strategy_section_0_stra_description', 'We begin by researching your target audience and developing a data-driven strategy that aligns with your business goals. This ensures the final product meets your needs and delivers tangible results.'),
(875, 22, '_strategy_section_0_stra_description', 'field_65d82e69958f0'),
(876, 22, 'strategy_section_1_stra_image', '305'),
(877, 22, '_strategy_section_1_stra_image', 'field_65d82e45958ee'),
(878, 22, 'strategy_section_1_stra_title', 'Creative'),
(879, 22, '_strategy_section_1_stra_title', 'field_65d82e57958ef'),
(880, 22, 'strategy_section_1_stra_description', 'Creative team develops a design that conveys your unique value proposition and drives results by creating an intuitive and engaging user experience, ensuring every aspect of the design meets your business objectives.'),
(881, 22, '_strategy_section_1_stra_description', 'field_65d82e69958f0'),
(882, 22, 'strategy_section_2_stra_image', '306'),
(883, 22, '_strategy_section_2_stra_image', 'field_65d82e45958ee'),
(884, 22, 'strategy_section_2_stra_title', 'Implementation'),
(885, 22, '_strategy_section_2_stra_title', 'field_65d82e57958ef'),
(886, 22, 'strategy_section_2_stra_description', 'Developers bring the design to life, ensuring the website or application is fully functional, responsive, and optimised for users, search engines optimisations and social media, conducting thorough testing to meet high-quality requirements.'),
(887, 22, '_strategy_section_2_stra_description', 'field_65d82e69958f0'),
(888, 22, 'strategy_section_3_stra_image', '304'),
(889, 22, '_strategy_section_3_stra_image', 'field_65d82e45958ee'),
(890, 22, 'strategy_section_3_stra_title', 'Testing'),
(891, 22, '_strategy_section_3_stra_title', 'field_65d82e57958ef'),
(892, 22, 'strategy_section_3_stra_description', 'Quality assurance is paramount. Dedicated testing team rigorously examines every aspect of your project to identify and address any potential issues. Through testing and debugging ensure that the final product meets the highest standards.'),
(893, 22, '_strategy_section_3_stra_description', 'field_65d82e69958f0'),
(894, 22, 'strategy_section_4_stra_image', '307'),
(895, 22, '_strategy_section_4_stra_image', 'field_65d82e45958ee'),
(896, 22, 'strategy_section_4_stra_title', 'Delivery'),
(897, 22, '_strategy_section_4_stra_title', 'field_65d82e57958ef'),
(898, 22, 'strategy_section_4_stra_description', 'In the final phase, working closely with you to ensure satisfaction and provide training and support for website management. Strive to establish long-term relationships to help you achieve your business objectives, monitoring website performance and providing ongoing optimisation for continued results.'),
(899, 22, '_strategy_section_4_stra_description', 'field_65d82e69958f0'),
