(12030, 345, 'strategy_section_0_stra_title', 'Strategy'),
(12031, 345, '_strategy_section_0_stra_title', 'field_65d82e57958ef'),
(12032, 345, 'strategy_section_0_stra_description', 'Process begins with developing a comprehensive strategy that aligns with your goals through research, ensuring the final product meets your needs and delivers tangible results.'),
(12033, 345, '_strategy_section_0_stra_description', 'field_65d82e69958f0'),
(12034, 345, 'strategy_section_1_stra_image', '305'),
(12035, 345, '_strategy_section_1_stra_image', 'field_65d82e45958ee'),
(12036, 345, 'strategy_section_1_stra_title', 'Creative'),
(12037, 345, '_strategy_section_1_stra_title', 'field_65d82e57958ef'),
(12038, 345, 'strategy_section_1_stra_description', 'Creative team develops a design that conveys your unique value proposition and drives results by creating an intuitive and engaging user experience, ensuring every aspect of the design meets your business objectives.'),
(12039, 345, '_strategy_section_1_stra_description', 'field_65d82e69958f0'),
(12040, 345, 'strategy_section_2_stra_image', '306'),
(12041, 345, '_strategy_section_2_stra_image', 'field_65d82e45958ee'),
(12042, 345, 'strategy_section_2_stra_title', 'Implementation'),
(12043, 345, '_strategy_section_2_stra_title', 'field_65d82e57958ef'),
(12044, 345, 'strategy_section_2_stra_description', 'Developers bring the design to life, ensuring the website or application is fully functional, responsive, and optimised for users, search engines optimisations and social media, conducting thorough testing to meet high-quality requirements.'),
(12045, 345, '_strategy_section_2_stra_description', 'field_65d82e69958f0'),
(12046, 345, 'strategy_section_3_stra_image', '304'),
(12047, 345, '_strategy_section_3_stra_image', 'field_65d82e45958ee'),
(12048, 345, 'strategy_section_3_stra_title', 'Testing'),
(12049, 345, '_strategy_section_3_stra_title', 'field_65d82e57958ef'),
(12050, 345, 'strategy_section_3_stra_description', 'Quality assurance is paramount. Dedicated testing team rigorously examines every aspect of your project to identify and address any potential issues. Through testing and debugging ensure that the final product meets the highest standards.'),
(12051, 345, '_strategy_section_3_stra_description', 'field_65d82e69958f0'),
(12052, 345, 'strategy_section_4_stra_image', '307'),
