(12054, 345, 'strategy_section_4_stra_title', 'Delivery'),
(12055, 345, '_strategy_section_4_stra_title', 'field_65d82e57958ef'),
(12056, 345, 'strategy_section_4_stra_description', 'In the final phase, working closely with you to ensure satisfaction and provide training and support for website management. Strive to establish long-term relationships to help you achieve your business objectives, monitoring website performance and providing ongoing optimisation for continued results.'),
