(12575, 359, '_strategy_section_2_stra_title', 'field_65d82e57958ef'),
(12576, 359, 'strategy_section_2_stra_description', 'Developers bring the design to life, ensuring the website or application is fully functional, responsive, and optimised for users, search engines optimisations and social media, conducting thorough testing to meet high-quality requirements.'),
(12577, 359, '_strategy_section_2_stra_description', 'field_65d82e69958f0'),
(12578, 359, 'strategy_section_3_stra_image', '304'),
(12579, 359, '_strategy_section_3_stra_image', 'field_65d82e45958ee'),
(12580, 359, 'strategy_section_3_stra_title', 'Testing'),
(12581, 359, '_strategy_section_3_stra_title', 'field_65d82e57958ef'),
(12582, 359, 'strategy_section_3_stra_description', 'Quality assurance is paramount. Dedicated testing team rigorously examines every aspect of your project to identify and address any potential issues. Through testing and debugging ensure that the final product meets the highest standards.'),
(12583, 359, '_strategy_section_3_stra_description', 'field_65d82e69958f0'),
(12584, 359, 'strategy_section_4_stra_image', '307'),
