(12919, 383, '_strategy_section_1_stra_title', 'field_65d82e57958ef'),
(12920, 383, 'strategy_section_1_stra_description', 'Creative team develops a design that conveys your unique value proposition and drives results by creating an intuitive and engaging user experience, ensuring every aspect of the design meets your business objectives.'),
