(12925, 383, '_strategy_section_2_stra_title', 'field_65d82e57958ef'),
(12926, 383, 'strategy_section_2_stra_description', 'Developers bring the design to life, ensuring the website or application is fully functional, responsive, and optimised for users, search engines optimisations and social media, conducting thorough testing to meet high-quality requirements.'),
