(12931, 383, '_strategy_section_3_stra_title', 'field_65d82e57958ef'),
(12932, 383, 'strategy_section_3_stra_description', 'Quality assurance is paramount. Dedicated testing team rigorously examines every aspect of your project to identify and address any potential issues. Through testing and debugging ensure that the final product meets the highest standards.'),
(12933, 383, '_strategy_section_3_stra_description', 'field_65d82e69958f0'),
