(13163, 385, '_strategy_section_0_stra_title', 'field_65d82e57958ef'),
(13164, 385, 'strategy_section_0_stra_description', 'Process begins with developing a comprehensive strategy that aligns with your goals through research, ensuring the final product meets your needs and delivers tangible results.'),
